@PoliticalNurse @gwalkerpoole1 @theRCN @RCN_NI_NRN @RCNStudents @RCNSWStudents @RCNSouthWest Very best wishes for your recovery.
Mr @Celia_Manson had similar surgery over five years ago. Recovered well.
Don't remember that he ever got breakfast in bed !

@gwalkerpoole1 Have a lovely day together today.
Do not leave it too long before the return match.
Very best wishes to you both.

@RCNWKentMedway members who are employed in NHS.
Look out for your voting papers from the RCN. -  coming soon.
Then please VOTE.

@ShirtyPhil Thanks @ShirtyPhil . Feel fortunate to have got anti-virals.
Bound to be a risk travelling to Glasgow and back and meeting so many people.
These new variations are apparently very contagious.

@ProfJuneG Oh June, I have missed your blog. Lovely to have it back; thank you.
You have cheered up my Covid + weekend.
I regret that I behaved very unprofessionally with NHS 111, although sadly the nurse there was unprofessional too !

@TuffreyWijne Irene, thinking of you.
Pleased to know that the Conquest Hospital looked after you well.
I married a young man ( no longer young, just turned 70 ) from Hastings.

RT @Crouchendtiger7: Oh my!  This is great - well done you @felicia_kwaku 
